import React from 'react'
import './CartOpenItem.css'
import { useDispatch } from 'react-redux'

const CartOpenItem = (item) => {
    return (
        <div className="cart-open__item">
                    <h3 className="cart-open__title">
                        {item.title}
                    </h3>
                    <span className="cart-open__price">{item.price} руб</span>
                    <button className="cart-open__deleted">x</button>
        </div>
    )
}

export default CartOpenItem
